INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job000','Not Employed','no job')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job001','Technical Analyst','A technical analyst, or technician, is a securities researcher who analyzes investments based on past market prices and technical indicators. Technicians believe that short-term price movements are the result of supply and demand forces in the market for a given security.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job002','Product Manager','A product manager is a professional role which is responsible for the development of products for an organization, known as the practice of product management.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job003','Data Engineer','Data engineers are the plumbers building a data pipeline, while data scientists are the painters and storytellers giving meaning to an otherwise static entity. Simply put, data engineers clean, prepare and optimize data for consumption.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job004','Data Quality RM','Data quality refers to the condition of a set of values of qualitative or quantitative variables.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job005','Senior Devops Engineer','There no formal career track for becoming a DevOps engineer. They are either developers who get interested in deployment and network operations, or sysadmins who have a passion for scripting and coding, and move into the development side where they can improve the planning of test and deployment.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job006','Senior Consultant','A consultant is a professional who provides expert advice in a particular area such as security, management, education, accountancy, law, human resources, marketing, finance, engineering, science or any of many other specialized fields')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job007','Advisory Consultant','In Risk and Financial Advisory, we work with CFOs and other corporate leadership to reduce, manage, and mitigate risk. We do this by helping clients improve processes and procedures in areas such as audit, regulatory compliance, mergers and acquisitions, cyber security, and technology.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job008','Technical Project Manager','Technical Project Management is the ability to support the management of an IT initiative from a concept through to a concrete deliverable as a project with specialist technical knowledge. Working with a project requires that we have clear goals, a defined scope and a definite start and end.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job009','Data Scientist','Data scientists are a new breed of analytical data expert who have the technical skills to solve complex problems â€“ and the curiosity to explore what problems need to be solved. They Are part mathematician, part computer scientist and part trend-spotter.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job010','Business Analyst','A business analyst (BA) is someone who analyzes an organization or business domain (real or hypothetical) and documents its business or processes or systems, assessing the business model or its integration with technology')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job011','Business Technology Analyst','Business technology analysts work with a business to assist in technology integration. This includes overseeing a companys current information technology (IT) systems to ensure that the companys technology-related goals are met.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job012','System Analyst','A systems analyst is a person who uses analysis and design techniques to solve business problems using information technology.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job013','Cybersecurity Professional','An advanced professional will hold a BS in a field such as information technology with a focus in an area such as computer forensics.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job014','Technical Consultant','Professionals, who provide technical support, perform trouble-shooting functions and resolve customer issues are known as Technical Consultants')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job015','Software Developer','A programmer, developer, dev, coder, or software engineer is a person who creates computer software')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job016','Product Analyst','Product analysts research target market segments based on age, gender, location, and interest and work with product managers to ensure products offer something for each of those demographics.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job017','Program Manager','Program management or programme management is the process of managing several related projects, often with the intention of improving an organizations performance')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job018','Marketing Coordinator','Markets products by developing and implementing marketing and advertising campaigns')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job019','IT Specialist','An IT Specialist, computer professional, or an IT professional may be: a person working in the field of information technology; ')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job020','Strategy Analyst','They develop and implement critical business solutions through information gathering, synthesis, review, and testing. ')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job021','Advanced Support Engineer','Expert support results in well-founded planning, optimally deployed technology, and in meeting or exceeding your return on investment objectives.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job022','Marketing Analyst','Marketing analysts (a.k.a. market research analysts) help companies and organizations decide which products and services to sell,')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job023','Business Intelligence Analyst','A business intelligence (BI analyst) is a professional role where the individual is responsible for analyzing data that is used by a business or organization')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job024','Solution Analyst','Solution Analyst is a member of the IT solutions team and is responsible for understanding business needs and collaborating with other technology stakeholders to deliver high quality, technology based, business solutions.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job025','Contract Compliance','Contract Compliance is state of acting in conformance with the predefined and agreed rules or guidelines. In many countries the contract compliance mainly deals with the adherence regarding equal opportunity policies and regulations')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job026','Quality Analyst','A software quality analyst is responsible for applying the principles and practices of software quality assurance throughout the software development life cycle.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job027','Integration Analyst','An integration analyst is tasked with planning, coordinating, and managing the assimilation of new software applications and programs into an organizations existing computer network.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job028','Product Associate','Production associates are generally in charge of ensuring correct quality control of materials and end products produced by a company')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job029','Computer System Analyst','Computer systems analysts, sometimes called systems architects, study an organizations current computer systems and procedures, and design solutions to help the organization operate more efficiently and effectively')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job030','Technology Consultant','In management, information technology consulting as a field of activity focuses on advising organizations on how best to use information technology in achieving their business objectives')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job031','Digital Marketing Analyst','A digital market analyst works to increase Internet traffic to websites, social media posts and other forms of online promotional content')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job032','Assistant Vice President','Assistant vice president is typically one rung below vice president in much of the financial services industry. Its a relatively common role within a firm, particularly for those in brokerage, securities, and investment banking')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job033','Data Analyst','Data analysts translate numbers into plain English Every business collects data, whether its sales figures, market research, logistics, or transportation costs')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job034','Developer','A programmer, developer, dev, coder, or software engineer is a person who creates computer software')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job035','Senior Associate','a senior associate is a higher rank on the organizational chart than an associate is')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job036','IT Process Designer','To create a process design for your business means youd be developing a strategy to carry out the businesss mission.')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job037','Senior Data Analyst','Higher level data analyst')
INSERT INTO [dbo].[JobRole] (jobId, jobTitle, jobDescription)Values ( 'job038','Test Engneer','A test engineer is a professional who determines how to create a process that would best test a particular product in manufacturing and related disciplines in order to assure that the product meets applicable specifications.')
